"""
3. 无重复字符的最长子串
给定一个字符串 s ，请你找出其中不含有重复字符的 最长子串 的长度。


示例 1：
    输入: s = "abcabcbb"
    输出: 3
    解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。

示例 2：
    输入: s = "bbbbb"
    输出: 1
    解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。

示例 3：
    输入: s = "pwwkew"
    输出: 3
    解释: 因为无重复字符的最长子串是"wke"，所以其长度为 3。请注意，你的答案必须是 子串 的长度，"pwke"是一个子序列，不是子串。

示例 4：
    输入: s = ""
    输出: 0

提示：
    - 0 <= s.length <= 5 * 104
    - s 由英文字母、数字、符号和空格组成
"""


class Solution:
    """
    看到题后的第一版，超时
    """

    def lengthOfLongestSubstring(self, s: str) -> int:
        len_s = len(s)
        if len_s == 1:
            return 1
        if not s:
            return 0
        result = []
        for index in range(len_s):
            item = s[index]
            if index == 0:
                result.append([item])
                continue
            result.append([item])
            for result_index in range(index):
                if "stop" in result[result_index]:
                    continue
                if item not in result[result_index]:
                    result[result_index].append(item)
                else:
                    result[result_index].append("stop")
        max_count = 0
        for item in result:
            len_item = len(item)
            if "stop" in item:
                len_item -= 1
            if len_item > max_count:
                max_count = len_item
        return max_count


class Solution2:
    """
    滑动窗口
    """
    def lengthOfLongestSubstring(self, s: str) -> int:
        string_set = set()
        nums = len(s)
        right_index, count = -1, 0
        for i in range(nums):
            # print(s[i])
            if i != 0:
                string_set.remove(s[i - 1])
            while right_index + 1 < nums and s[right_index + 1] not in string_set:
                # if s[right_index + 1] not in string_set:
                #     # print(s[i])
                #     # print()
                #     # print()
                #     if i + 1 < nums:
                #         string_set = set(s[i + 1])
                #     right_index += 1
                #     break
                string_set.add(s[right_index + 1])
                right_index += 1
            if right_index - i + 1 > count:
                count = right_index - i + 1
        return count


